import React, { useEffect, useState } from 'react';
import axios from 'axios';
import Question from './Question';

function Retrieve()
{
    const [itemList, setItemList] = useState([])
    useEffect(()=>{
        axios.get('http://localhost:8081/getQues/')
        .then((res)=>{
            console.log(res);
            res.data.map((element, index)=>{
                let idx = itemList.findIndex(e=>e.quesNo = element.ques_no);
                console.log(idx);
                if(idx <= -1)
                {
                    const list = {
                        quesNo:element.ques_no,
                        quesText:element.ques_text,
                        quesType:element.ques_type,
                        answerList:[]
                    }
                    itemList.push(list);
                    idx = itemList.length - 1;
                }
                itemList[idx].answerList.push({
                    ansNo:element.ans_no,
                    ansText:element.option_text
                });
                
            });
            setItemList(itemList);
        })
        .catch((err)=>console.log(err));
    });
return(
    
<div>
    <table className='table table-primary w-100'>
        <tbody>
        {alert(itemList[0].quesNo)}
        {itemList.map((element, index)=>(<Question key={index} question = {element}/>))}
        </tbody>
    </table>
</div>);
}

export default Retrieve;
